import React from "react";
// import { Layout } from "antd";
import { Layout, Avatar, Menu, Button, Row, Col, Carousel, Icon } from "antd";
const { Header, Slider, Content } = Layout;
import style from "./Head.module.css";
export default function Head() {
  return (
    <div>
      <Header>
        <div className="logo">
          <img style={{ borderRadius: "4px" }} src="./images/logo2.jpeg" />
        </div>
        <Menu
          style={{
            float: "right",
            backgroundColor: "transparent !important",
            color: "#d8d8d8",
          }}
          mode="horizontal"
          defaultSelectedKeys={["1"]}
        >
          <Menu.Item>Home</Menu.Item>
          <Menu.Item key="2">OUR FOOD</Menu.Item>
          <Menu.Item key="3">Ram</Menu.Item>
          <Menu.Item>
            <Avatar
              className={style.avatar}
              src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"
            />
          </Menu.Item>
        </Menu>
      </Header>{" "}
    </div>
  );
}
